import styled from 'styled-components'

const Primary = ({className, children, navitem}) => (
  <PrimaryStyles className={className}>
    {children}
  </PrimaryStyles>
);

const PrimaryStyles = styled('div')`
  background: var(--purple300);
  height: 100vh;
  grid-column: 1/2;
`;

export default Primary;
